UnsupportedNamespace = 不支持 "%S" 名字空间。请使用 "http://www.mozilla.org/2002/soap/security"。
UnknownRootElement = 根元素 "%S" 无法识别。请使用 "webScriptAccess" 元素。
UnknownElement = 元素 "%S" 无法识别。
UnknownAttribute = 属性 "%S" 无法识别。
TooManyElements = 不允许多于一个 "%S" 元素。
ElementHasSibling = "%S" 元素不能拥有 "%S" 兄弟。
ElementNotEmpty = "%S" 元素必须非空。
SOAPFault = SOAP { %S } %S 调用返回错误结果: { %S } %S : %S.

